RACE DAY 🌍🇦🇺

@laurenryan____ will be making her Outdoor World Championships debut in Budapest representing Australia in the 5000m. She races in the 1st Heat of the 5000m Heats at 7:02pm 🚀

#BaltimoreDistance #WorldChampionships #Australia #UnderArmour #ProtectThisHouse

We are excited to announce that @athleticsaustralia pro track athlete @laurenryan____ has joined the newly formed @zuumathleteclub. Lauren is one of Australia’s top runners, recently competing at the 23’ World Championships in Budapest. We recently caught up with Lauren at the Tan track where she holds the record for the 9th fastest female time. 

@zuumathleteclub @laurenryan____ @chemistwarehouseaus 

